import { useEffect, useState } from "react";


const images = [
  { src: 'data:image/jpeg;base64,', alt: 'Image 1' ,title: 'WE SERVE FRESH VEGETABLES & FRUITS'},
  { src: 'data:image/jpeg;base64,', alt: 'Image 2',title: '100% FRESH &ORGANIC FOODS' }
];
const Sliders=()=>{

    const [currentIndex, setCurrentIndex] = useState(0);
      
      useEffect(() => {
        const interval = setInterval(() => {
          setCurrentIndex(prevIndex => (prevIndex + 1) % images.length);
        }, 2000);
    
        return () => clearInterval(interval);
      }, [images.length]);
    return(
        <section className="slider">
          {images.map((image, index) => (
            <img
              key={index}
              src={image.src}
              alt={image.alt}
              className={index === currentIndex ? 'active' : ''}
            />
          ))}
          <div className="slider-overlay">
            <h2 className="slider-title">{images[currentIndex].title}</h2>
            <a href="#shop" className="slider-btn">View details</a>
          </div>
          
        </section>
        
    )
}
export default Sliders;